import { Route, Switch, Redirect } from "react-router-dom";

import QuoteList from "./components/quotes/QuoteList";

function App() {
  return (
    <div>
      <Route path="/quotes">
        <QuoteList />
      </Route>
      <Route path="quotes/:quoteId"></Route>
    </div>
  );
}

export default App;
